window.bookSummaryJSON = "<p>Medium Pyper Rayne and her witch boyfriend Julius are on an impromptu getaway in southern Louisiana. The quaint bayou town has everything: a Victorian inn, a famous brew pub, the best beignets this side of the Mississippi. Oh and an infamous bayou biker gang. </p> <p>When a ghost rider suddenly appears with clues to an unsolved kidnapping, Pyper and Julius find themselves smack in the middle of a crime ring. Only not everyone is who they seem. They'll need to untangle the web of secrets and figure out who to trust before they risk everything...including their own lives. </p>"; 
